import React from "react";
import styled from "styled-components";
import InputBox from "../components/Share/InputBox";

const Background = styled.div`
  width: 100vw;
  min-height: 100vh;
  background: #fdfbf8;

  display: flex;
  justify-content: center;
  align-items: center;
`;

const Box = styled.div`
  width: 540px;
  height: 746px;
  border: 1px solid black;
`;

const TitleText = styled.div`
  color: #000;
  font-family: Roboto;
  font-size: 32px;
  font-style: normal;
  font-weight: 600;
  line-height: 40px;
`;

const Input = styled.input`
  width: 350px;
  height: 50px;
  flex-shrink: 0;
  border-radius: 10px;
  border: 2px solid #000;
  background: #fdfbf8;
  padding: 10px; /* 내부 여백 */
  font-size: 16px; /* 입력 글씨 크기 */
  box-sizing: border-box;

  margin-top: 20px;
`;

export default function Signup() {
  return (
    <Background>
      <Box>
        <TitleText>회원가입</TitleText>
        <InputBox label="이름" type="text"></InputBox>
        <InputBox label="이메일" type="email"></InputBox>
        <Input></Input>
        <InputBox label="닉네임" type="email"></InputBox>
        <InputBox label="비밀번호" type="password"></InputBox>
      </Box>
    </Background>
  );
}
